<script>
    let newsletter = $('#newsletter');
    newsletter.submit(function (e) {
        e.preventDefault();
        let form = $(this);
        let url = form.attr('action');
        let data = form.serialize();
        $.ajax({
            url: url,
            type: 'POST',
            data: data,
            success: function (response) {
                if (response.status === true) {
                    form.find('button[type="submit"]').attr('disabled', true);
                    form.find('input[name="email"]').attr('disabled', true);
                    form.find('button[type="submit"]').html('<svg class="icon"><use xlink:href="#icon-check"></use></svg>');
                    localStorage.setItem('newsletter', form.find('input[name="email"]').val());
                    form.find('.text--error').remove();
                }
            },
            error: function (response) {
                form.find('.text--error').remove();
                $.each(response.responseJSON.errors, function (key, value) {
                    let input = $('[name^=' + key + ']').parents('.f-parent');
                    input.append('<span class="text-style text-style--xsmall text--error row">' + value + '</span>');
                });
            }
        });
    });

    if (localStorage.getItem('newsletter')) {
        newsletter.find('button[type="submit"]').attr('disabled', true);
        newsletter.find('input[name="email"]').attr('disabled', true);
        newsletter.find('input[name="email"]').attr('value', localStorage.getItem('newsletter'));
        newsletter.find('button[type="submit"]').html('<svg class="icon"><use xlink:href="#icon-check"></use></svg>');
    }
</script>
